import React, { Component } from "react";
 
class About extends Component {
  render() {
    return (
      <div>
        <h2>ABOUT</h2>
        <p>I am a designer and developer.</p>
        <p>My Skillset: </p>
          <il>HTML</il>
          <il>CSS</il>
          <il>Javascript</il>
          <il>Python</il>
          <il>C#</il>
          <il>Java</il>

      </div>
    );
  }
}
 
export default About;
